import React from 'react';
import DocumentLink from './documentLink';



//This component will display a list of objects in a form of buttons/links


const DocumentList = (props) => {

  //test object
  const tempObj = {
    test1: {
      name: 'cats.md',
      date: '01/01/2023'
    },
    test2: {
      name: 'burger.md',
      date: '02/02/2023'
    }
  };


  //iterate through object
  const objHandler = () => {
    try {
      let stringTester = '';

      Object.entries(tempObj).forEach(([_, value]) => stringTester += `<DocumentLink name={${value.name}} date={${value.date}} /> ` );

      console.log(stringTester)

      const parser = new DOMParser();
      const result = parser.parseFromString(stringTester, 'text/html');

      return result;
    } catch(error) {
      console.log('did not succeed');
    }
    // return (
      //<DocumentLink title={title} date={date} />
    // )
  };

  let string = objHandler()


  // let stringTester = '';

  // Object.entries(tempObj).maps(([_, value]) => stringTester += `<div name={${value.name}} date={${value.date}} /> ` )

  //passes temp obj through as an argument
  // const list = objHandler(tempObj);

  return(
    <div id='document-container' style={{color: 'white'}}>
      {string}
    </div>
  );
}

export default DocumentList;
